import React from "react";
import myVideo from "https://www.pexels.com/video/4507628/download/?h=1080&w=1920"

function VideoBG(){
    return (
        <>
        <video playsInline autoPlay muted loop>
        <source src={myVideo} type="video/mp4"> </source>
      </video>
      </>
    )
}

export default VideoBG;
